import { useSelector, useDispatch } from 'react-redux'
import { login, logout } from './loginReducer'
import Login from './login'

//====================================================
// these are assets i created with a personal project
// so variable name doesn't line up with login
// just wanted to mention that so i dont look like 
// big dumb dumb doing .signup -> login comp
//====================================================
import './styles/App.css'
import './styles/main.css'

function App() {
  const auth = useSelector((state) => state.auth.username)
  const dispatch = useDispatch()
  return (
    <div className="App">
      <Login />
      <button onClick={() => dispatch(login('fabric'))} >do some shit</button>
      <div>{auth}</div>
      <button onClick={() => dispatch(logout())} >logout</button>
    </div>
  );
}

export default App;
